import './App.css';
import { useState } from "react";

function App() {
  const [count, setCount] = useState(0);

  return (
      <div className="App">
        <div style = {{textAlign: "center"}}>
          <h1>CS5610 Mini Assingment 3</h1>
          <h5>React and JavaScipt</h5>
          <p style = {{fontSize: 50, fontWeight: "bold", fontFamily: "gerogia"}}>Count: {count}</p>
        </div>

        <div style={{
            display: "grid",
            gridTemplateColumns: "1fr 1fr",
            gridTemplateRows: "1fr 1fr",
            gap: "10px",
            width: "200px",
            height: "200px",
            margin: "auto"
        }}>
            <div style={{ background: "lightblue", display: "flex", alignItems: "center", justifyContent: "center" }}>1</div>
            <div style={{ background: "lightcoral", display: "flex", alignItems: "center", justifyContent: "center" }}>2</div>
            <div style={{ background: "lightgreen", display: "flex", alignItems: "center", justifyContent: "center" }}>3</div>
            <div style={{ background: "lightgoldenrodyellow", display: "flex", alignItems: "center", justifyContent: "center" }}>4</div>
        </div>
      </div>
  );
}

export default App;
